import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";

import notesArr from "../notes" 


function App() {
  return (
    <div>
      <Header />
      {notesArr.map((note)=>{
        return (
            <Note 
      key={notesArr[1].id}
      title={notesArr[1].title} 
      content={notesArr[1].content}
      />
        );
      })}
      <Footer />
    </div>
  );
}

export default App;
